I thought I lost this gem, but finally found it! A video after a close encounter with a Kodiak Brown bear. The events that happened just moments after the @meateater crew was charged in Alaska with @stevenrinella
@janis_putelis and
@christophergill

You are in double luck because you can hear about ways to stay safe in Bear country on my new podcast this week! Just search the title: Cutting the Distance, it is available anywhere podcasts are found!

This was the video a lot of you who heard the story on the @joerogan podcast asked me to post again. I thought I lost it but turns out I had it all along. Enjoy!
